import React,{Fragment} from 'react';
import Container from '@material-ui/core/Container';
import Background from './ba';
import BasicInfo from './BasicInfo';
import MoreInfo from './MoreInfo';
import Reviews from './Reviews';
import {content} from '../Styles/App.module.scss';



function App() {
  return (   
    <Fragment>
      <Container maxWidth="md"  className={content}>
        <Background />
        <BasicInfo />
        <MoreInfo />
        <Reviews />
      </Container>
      <div class="pen-container"><svg width="16" height="16" viewBox="0 0 16 16" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink" class="pen" data-ui-test="pen-svg"><use x="0" y="0" width="16" height="16" xlinkHref="/images/icons/icon_definitions.svg#pen"></use></svg></div>
    </Fragment>

  );
}

export default App;
